import Task from './Task'

// Destructuring tasks passed in from App.js
const Tasks = function( {tasks} )
{
    return(
        <>
            {
                tasks.map(           /* Looping through each component in tasks Object*/
                    (tasks) => (     /* tasks is input for Arrow Function */
                        <Task
                            key = {tasks.id} /* Output component as key */
                            task = {Task}    /* Pass in Task as Prop */
                        />
                    )
                )
            }
        </>
    )
}

export default Tasks
